import React from "react";
import { Table } from 'reactstrap';


const WorkoutWeekTable = ({workouts}) => {

    return (

<div>
    <ul>
        {workouts.map(workout => <li key={workout.id}>{workout.name}</li>)}
    </ul>
</div>

    )
}

export default WorkoutWeekTable;
